import './nav.css'

function nav() {
    const [showLinks,setShowLinks]=useState(false);
    return (
        <div className='navContainer' id={showLinks? "hidden":""}>
            <div className='navLogo'>logo</div>
             <div className='navService'>Service</div>
             <div className='navAboutus'>AboutUs</div>
             <div className='navOurwork'>Our Work</div>
             <div className='navContact'>Contact</div>
             <button className='navMenu'>menu</button>
            </div>
        
    );
}

export default nav;
